function task1Check() {
	var target = 0;
	for (var gid in entitys) {
		var entity = entitys[gid];
		if (entity.ntype == NodeTypeClass.build && entity.data.groupname == GroupType.plant){
			target++;
			if(target >= 4)
				return true;
		}
	}
	return false;
}

function task2Check() {
	var target = 0;
	for (var gid in entitys) {
		var entity = entitys[gid];
		if (entity.ntype == NodeTypeClass.build && entity.data.housetype == buildTypes.cottage){
			target++;
			return true;
		}
	}
	return false;
}

